import React from "react";
import './Button.css';

export default function Button(props) {
    const { style, styleTitle, onClick, children } = props;

    const buttonClassName = `button ${style || ""}`;
    const titleClassName = `button-title ${styleTitle || ""}`;

    return (
        <div className={buttonClassName} onClick={onClick}>
            <h1 className={titleClassName}>
                {children}
            </h1>
        </div>
    );
}
